VALUES ('3256222233772', 'Mini vennoiseries assorties', 'Mini Pain au chocolat : farine de BLE, BEURRE 19%, eau, chocolat 14% (sucre, pâte de cacao, beurre de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille), levure, sucre, OEUF entier, sel, GLUTEN de BLE, enzymes, agent de traitement de la farine : acide ascorbique, dorure (OEUF entier, eau). Pourcentages exprimés sur le mini pain au chocolat. Mini Croissant : farine de BLE, BEURRE 23%, eau, levure, sucre, OEUF entier, sel, GLUTEN de BLE, enzymes, agent de traitement de la farine : acide ascorbique, dorure (OEUF entier, eau). Pourcentage exprimé sur le mini croissant. Traces éventuelles de fruits à coque.', '', '20', '12.6', '39', '5.6', '1.9', '6.8', '1', '0.393700787401575', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256222234465', 'Cônes vanille fraise', 'LAIT écrémé reconstitué, eau, gaufrette 14.8%* (farine de BLE, sucre, graisse végétale de coprah, émulsifiant : lécithine de SOJA, sel), sauce aux fruits rouges 11%* [purée de fruits rouges 4.9%* (fraise, framboise, myrtille, cassis), sucre, sirop de glucose-fructose, eau, sirop de sucre inverti, amidon modifié de maïs, gélifiants : gomme xanthane, farine de graines de caroube, acidifiant : acide citrique, colorant : anthocyanes, régulateur d\'acidité : citrates de sodium, extrait de curcuma et d\'hibiscus], chemisage au cacao maigre 8.6%* (graisse végétale de coprah, sucre, cacao maigre en poudre 0.7%*, émulsifiant : lécithine de SOJA), sirop de glucose-fructose, sucre, purée de fraise 4.9%*, graisse végétale de coprah, LACTOSERUM en poudre, jus de fraise à base de concentré 3%*, concentré de protéines de sérum (LAIT), émulsifiant : mono et diglycérides d\'acides gras de colza, gélifiants : farine de graines de caroube et gomme guar, arôme naturel de vanille, arôme naturel, concentré de betterave rouge, concentré de carotte, acidifiant : acide citrique.* Les pourcentages sont exprimés sur le produit fini. Traces éventuelles de fruits à coques, arachide et oeuf.', 'https://static.openfoodfacts.org/images/products/325/622/223/4465/front.10.400.jpg', '9.3', '8.5', '36.1', '28', '0.9', '2.4', '0.12', '0.047244094488189', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256222234526', 'Cônes vanille', 'Crème glacée à la vanille 38,2% : LAIT écrémé reconstitué, eau, sirop de glucose-fructose, CREME, sucre, LACTOSERUM, concentré de protéines de SERUM, émulsifiant : mono et diglycérides d\'acides gras de colza, gélifiants : farine de graines de caroube - gomme guar, arôme naturel de vanille, colorants : rocou et curcumine.Crème glacée à la vanille 31,9% : LAIT écrémé reconstitué, eau, sirop de glucose-fructose, CREME, sucre, LACTOSERUM, concentré de protéines de SERUM, arôme naturel de vanille, gousses de vanille épuisées broyées 0,2%*, émulsifiant : mono et diglycérides d\'acides gras de colza, gélifiants : farine de graines de caroube - gomme guar, colorants : rocou et curcumine. * Pourcentage exprimé sur la crème glacée à la vanille.Gaufrette 15% : farine de BLE, sucre, graisse végétale de coprah, émulsifiant : lécithine de SOJA, LACTOSE, protéines de LAIT, glucose, sel.Chemisage et Enrobage au cacao maigre 13.3% : graisse végétale de coprah, sucre, cacao maigre en poudre 9%*, émulsifiant : lécithine de SOJA. * Pourcentage exprimé sur le chemisage et l\'enrobage au cacao maigre.Nougatines d\'amandes 1.6% : sucre, AMANDES 30 %*. * Pourcentage exprimé sur les nougatines d\'amandes.Traces éventuelles d\'autres fruits à coques, arachide et oeuf.', '', '6.8', '5.2', '21.5', '16', '0.5', '1.6', '0.07', '0.0275590551181102', '', '1');

