VALUES ('3256222234564', 'Cônes chocolat', 'Crème glacée au chocolat 38.4 % : LAIT écrémé reconstitué, sirop de glucose-fructose, CREME, eau, sucre, poudre de cacao, chocolat noir 2%* (pâte de cacao 69.3%, sucre, cacao maigre en poudre, émulsifiant : lécithine de tournesol, arôme vanille), LACTOSERUM, émulsifiant : mono et diglycérides d\'acides gras de colza, gélifiants : farine de graines de caroube - gomme guar, concentré de protéines de SERUM. * Pourcentage exprimé sur la crème glacée au chocolat.Crème glacée au chocolat avec des copeaux de chocolat noir en inclusion 31.7% : LAIT écrémé reconstitué, sirop de glucose-fructose, CREME, eau, sucre, poudre de cacao, copeaux de chocolat noir 4.4%* (pâte de cacao 48.8%, sucre, beurre de cacao, matière grasse LAITIERE, émulsifiant : lécithine de SOJA, arôme naturel de vanille), chocolat noir 2%* (pâte de cacao 69.3%, sucre, cacao maigre en poudre, émulsifiant : lécithine de tournesol, arôme vanille), LACTOSERUM, émulsifiant : mono et diglycérides d\'acides gras de colza, gélifiants : farine de graines de caroube - gomme guar, concentré de protéines de SERUM. * Pourcentages exprimés sur la crème glacée au chocolat.Gaufrette 15% : farine de BLE, sucre, graisse végétale de coprah, émulsifiant : lécithine de SOJA, LACTOSE, protéines de LAIT, glucose, sel.Chemisage et Enrobage au cacao maigre 13.3% : graisse végétale de coprah, sucre, cacao maigre en poudre 9%*, émulsifiant : lécithine de SOJA. * Pourcentage exprimé sur le chemisage et l\'enrobage au cacao maigre.Nougatines d\'amandes 1,6% : sucre, AMANDES 30%*. * Pourcentage exprimé sur les nougatines d\'amandes.Traces éventuelles d\'autres fruits à coque, arachide et oeuf', 'https://static.openfoodfacts.org/images/products/325/622/223/4564/front.7.400.jpg', '13.4', '9.3', '39.4', '32', '0.8', '3.6', '0.02', '0.0078740157480315', '', '0');

