sformés de pomme de terre, préparation pour béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, épices), arôme naturel (LAIT), OEUFS en poudre, sel ; saupoudrage 4,5% : EMMENTAL. **pâte feuilletée dorée pur beurre : farine de BLE, BEURRE 17.9%, eau, sel, LACTOSE, protéines de LAIT, CREME en poudre, OEUFS en poudre. % exprimés sur chaque variété d\'apéritif Traces éventuelles de graines de sésame, crustacés, mollusques, céleri, moutarde et fruits à coques.', '', '15.4', '9.5', '30.6', '1.9', '1.3', '6.1', '0.9', '0.354330708661417', '', '1');

